  const li = [
               { 'name' : 'Friend #1'},
               { 'name' : 'Friend #2'},
               { 'name' : 'Friend #3'},
               { 'name' : 'Friend #4'},
               { 'name' : 'Friend #5'},
               { 'name' : 'Friend #6'},
             ]

  return (
    <View>
      <Text style={ styles.textTitle }>Mobile Apps</Text>
      <FlatList 
        data={li} 
        renderItem={ (items)=>{
          return (
            <Text style={ styles.textSub }>
              {}
            </Text>
          )
        }}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  textTitle : {
    fontSize : 40,
    color    : 'white',
    textAlign : 'center',
    backgroundColor : 'black',
  },

  textSub : {
    fontSize : 20,
    marginVertical : 10,
  }

});


export default list;
